import React from 'react';
import './Home.css';
import './Chat.css';

function Chat(){
    return (
        <div>
            <div className="ContainerT">
                <h1 className="Title1"> Chat </h1>
            </div>
            <div className="Txtb">
                <textarea readOnly className="Chatb" />
            </div>
            <input className="Searchc" />
        </div>
       
    );
}

export default Chat;
